import React from "react";
import styled from "styled-components";
import { HobbyCard } from "../../share-components/Cards/HobbyCard";


const Hobby = ()=>{
    return(
        <Wrapper>
            <HobbyCard name={"Piano"} description={"I enjoy playing the piano"}/>
            <HobbyCard name={"Video Game"} description={"I am an avid gamer"}/>
            <HobbyCard name={"Weightlifting"} description={"I like to lift heavy weight"}/>
            <HobbyCard name={"Travel"} description={"Travel to place"}/>
        </Wrapper>
    )
}


export {Hobby};

const Wrapper = styled.div`
display:flex;
flex-direction:row;
justifyContent: center;
`;
